let btn=document.querySelector("#clickbtn");
        let popup=document.querySelector(".popup");
        let close=document.querySelector("#close");
        btn.addEventListener("click",()=>{
           
               popup.style.display="flex";
           
        })
        close.addEventListener("click",()=>{
            popup.style.display="none";
        })
        let cart=[];
        let things={"Phones":{"Samsang Galaxy A73":"data:image/jpeg;base64,",
        "Redmi":"data:image/jpeg;base64,"},
        "Foods":{"Fruits":"data:image/jpeg;base64, "},

        "Shoes":{
            "Adidas":"data:image/jpeg;base64,",
            "Puma":"data:image/jpeg;base64,"
        }
    }
       var prices={"Samsang Galaxy A73":23000,"Redmi":20000,"Fruits":60,"Adidas":9000,"Puma":8500};
       let count=0;
        document.addEventListener("DOMContentLoaded", function() {
            let keys = document.querySelector("#key");
            let values = document.querySelector("#value");
            let block = document.querySelector("#block");
    
            // Populate options in "value" select based on the selected "key"
            keys.addEventListener("change", () => {
                let val = keys.value;
                let thing = things[val];
                block.textContent = "";
                let temp = document.createElement("option");
                temp.textContent = "select the options";
                
                values.textContent = "";
                values.append(temp);
                for (let i in thing) {
                    let option = document.createElement("option");
                    option.textContent = i;
                    values.append(option);
                }
            });
    
            // Handle change event for "value" select
            values.addEventListener("change", () => {
                if (values.value === "select the options") {
                    block.textContent = '';
                } else {
                    block.textContent = "";
                    let val = things[keys.value][values.value];
                    let div = document.createElement("div");
                    let h2 = document.createElement("h2");
                    let img = document.createElement('img');
                    let button = document.createElement('input');
                    let price=document.createElement("span");
                    price.textContent="$"+prices[values.value];
                    h2.textContent = values.value;
                    img.src = val;
                    button.value = "Add to Cart";
                    button.type = "button";
                    button.id = "btnsubmit";
                    price.id="upside";
    
                    div.append(h2);
                    div.append(img);
                    div.append(button);
                    div.append(price);
    
                    block.append(div);
                    let pops=document.querySelector("#pops1");
                    let pops1=document.querySelector("#pops");
                    // Attach event listener to "Add to Cart" button
                    button.addEventListener("click", () => {
                        console.log("clicked");
                        let addToCart = confirm("You want to add item to Cart?");
                        if (addToCart) {
                            // Add your logic to add the item to the cart here
                            // cart.push(values.value);
                            // cart[values.value]="23000";

                            let li=document.createElement("li");
                            let span1=document.createElement("span");
                            let span2=document.createElement("span");
                            span1.textContent=values.value;
                            span2.textContent="$ "+prices[values.value];
                            count+=prices[values.value];
                            li.append(span1);
                            li.append(span2);
                            pops.append(li);
                            let h1=document.querySelector("#display");
                            h1.textContent="$"+count;
                            // pops1.append(h1);
                            // console.log("hi"+cart[values.value]+""+localStorage.getItem("items"));
                            console.log("Item added to Cart!"+cart);
                            
                            
                        } else {
                            console.log("Item not added to Cart.");
                        }
                    });   
                }
            });
            // localStorage.setItem("items",cart);
            // Trigger change events to populate initial options
            // localStorage.setItem("items",cart);
            keys.dispatchEvent(new Event("change"));
            values.dispatchEvent(new Event("change"));
        });
        
   